import logo from "./logo.svg";
import "./App.css";
import MovieList from "./components/MovieList";
function App() {
  function fetchMoviesHandler() {
    fetch("https://swapi.dev/api/films/");
  }
  return (
    <div className="App">
      <section>
        <button>Fetch Movies</button>
      </section>
      <section>
        <MovieList />
      </section>
    </div>
  );
}

export default App;
